import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Locate and click a product card to open the details modal
    // Using a locator that finds a card containing specific text for robustness
    const productCardLocator = page.locator('.product-card', { hasText: 'Sony WH-1000XM5' });
    await productCardLocator.waitFor({ state: 'visible', timeout: 5000 });
    await productCardLocator.click();

    // 2. Wait for the modal and take a screenshot
    await page.waitForSelector('.product-detail', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_visible.png'));

    // 3. Locate and click the "Add to Wish List" button inside the modal
    const addToWishlistButton = page.getByRole('button', { name: 'Add to Wish List' });
    await addToWishlistButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToWishlistButton.click();

    // 4. Wait for the success notification and take a final screenshot
    const notificationLocator = page.locator('.notification.success');
    await notificationLocator.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_added.png'));

    // 5. Extract data to verify the action
    const notificationText = await notificationLocator.textContent();

    return {
      success: true,
      action: "Added a product to the wishlist and verified the success notification.",
      extractedData: {
        notification: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error if possible
    const screenshotsOnError = [];
    try {
      const errorPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorPath });
      screenshotsOnError.push(errorPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: screenshotsOnError,
      error: error.message
    };
  }
}
